import React from 'react';
import cardOne from '../../assets/cardOne.jpg';
import cardTwo from '../../assets/cardTwo.jpg';
import cardThree from '../../assets/cardThree.jpg';
import cardFour from '../../assets/cardFour.jpg';
import Cards from './cards';


function ListCard({search}) {
  const SearchContext = React.createContext('')

  const cards = [
    {
      id: 1,
      img: cardOne,
      name: 'Сырная',
      desc: 'Моцарелла, смесь сыров чеддер и пармезан, соус альфредо...',
      price: 'от 295 som',
      style: { marginTop: '10px' }
    },
    {
      id: 2,
      img: cardTwo,
      name: 'Двойной цыпленок',
      desc: 'Двойная порция цыпленка,моцарелла, соус альфредо...',
      price: 'от 325 som'
    },
    {
      id: 3,
      img: cardThree,
      name: 'Кебаб пицца',
      desc: 'Донерное мясо из говядины, моцарелла, томаты, красный лук,...',
      price: 'от 325 som'
    },
    {
      id: 4,
      img: cardFour,
      name: 'Бургер-пицца',
      desc: 'Ветчина из цыпленка, моцарелла, лук красный, томаты, соленые огурчики...',
      price: 'от 445 som'
    },
  ];

  return (
    <div>
        <Cards cards={cards} />
    </div>
  )
}

export default ListCard;
